import Link from 'next/link'

export default ({ url: { query: { q } } }) => {
  return (
    <div>
      <div>Here goes the question number { q }, I guess?</div>
      <p>Something informative, but smol</p>
      <div>First Answer</div>
      <div>Second Answer</div>
      <div>Third Answer</div>

      { next = parseInt(q) + 1 }

      <Link href={{ pathname: 'question', query: { q: next }}} as={ "/question/" + next }>
        <button>Next</button>
      </Link>
    </div>
  )
}
